const Layout: React.FC<props> = (props) => {
  const projects = useProjectModal();
  const [isOpen, toggleOpen] = useCycle(false, true);
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    const timer = setTimeout(() => {
      setIsLoading(false);
    }, 3800);
    return () => clearTimeout(timer);
  }, []);
  return (
    <motion.div className={`relative mx-auto min-h-screen overflow-hidden bg-[#1d1d1d] ${isOpen?'max-h-screen':''}`}>
      {!isLoading && (
        <div className="absolute top-0 left-0 right-0 bottom-0 max-w-[200vw]">
          <Canvas />
        </div>
      )}

    
      <Header toggleOpen={toggleOpen} isOpen={isOpen} />
      {!isLoading && (
        <AnimatePresence>
          {isOpen && <Menu isOpen={isOpen} toggleOpen={toggleOpen} />}
        </AnimatePresence>
      )}
      {!isLoading && (
        <AnimatePresence>
          {projects.prjectNumber != 0 && <Project1DetailsWrapper />}
        </AnimatePresence>
      )}
      {/*  <AnimatePresence initial={false}>
        {projects.prjectNumber == 1 && <Project1DetailsWrapper />}
        {projects.prjectNumber == 2 && <Project2DetailsWrapper />}
      </AnimatePresence> */}
      {!isLoading && <main>{props.children}</main>}
    </motion.div>
  );
};

